import React, { Component } from 'react';
import { iconAllocatedKuota } from '../../../../Assets/Shared';
import {
   DropDown,
   Image,
   View
} from '../../../Lib';
import { Colors } from '../../../Themes';
export default class TopMenu extends Component {
   constructor(props) {
      super(props);
   }

   _renderTopMenu = () => {
      return (
         <View style={styles.container}>
            <DropDown />

            <Image
               style={styles.topMenuIcon}
               src={iconAllocatedKuota}
            />
         </View>
      );
   }

   render() {
      return (
         this._renderTopMenu()
      );
   }
}

const styles = {
   container: {
      backgroundColor: Colors.darkBlue,
      paddingTop: 8,
      paddingBottom: 8,
      flexDirection: 'row',
      justifyContent: 'flex-end',
      paddingRight: 48
   },
   topMenuIcon: {
      marginLeft: 24
   }
}
